§12
Rechte der Mitglieder
Jedes Mitglied hat das Recht,
a) die Einrichtungen der Genossenschaft nach Maßgabe der dafür getroffenen Bestimmungen zu
benutzen, wobei die Belieferung mit Wärme voraussetzt, dass ein Anschluss des Mitglieds an das
Nahwärmenetz mit wirtschaftlich vertretbarem Aufwand möglich ist;
b) an der Generalversammlung, an ihren Beratungen, Abstimmungen und Wahlen teilzunehmen und dort
Auskünfte über Angelegenheiten der Genossenschaft zu verlangen, soweit dem § 36 Abs. 2 nicht
entgegensteht;
c) Anträge für die Tagesordnung der Generalversammlung gemäß § 30 Abs. 4 einzureichen;
d) Anträge auf Einberufung einer außerordentlichen Generalversammlung gemäß § 30 Abs.2
einzureichen;
