§18
Berichterstattung gegenüber dem Aufsichtsrat
Der Vorstand hat dem Aufsichtsrat mindestens halbjährlich, auf Verlangen oder bei wichtigem Anlass
unverzüglich vorzulegen,
a) eine Übersicht über die geschäftliche Entwicklung der Genossenschaft anhand von
Zwischenabschlüssen oder betriebswirtschaftlichen Auswertungen;
b) eine Aufstellung über die Gesamtverbindlichkeiten der Genossenschaft einschließlich der
Eventualverbindlichkeiten;
c) eine Übersicht der Forderungen der Genossenschaft;
d) einen Bericht über besondere Vorkommnisse; hierüber ist vorab erforderlichenfalls unverzüglich der
Vorsitzende des Aufsichtsrats zu verständigen;

